import React from "react";
import { Button, Control, Input, Field, Label } from "react-bulma-components";

function BookForm() {
  const form = {
    name: "Hermes",
    password: "12345",
  };
  return (
    <>
      <Field>
        <Control>
          <Label>Name</Label>
          <Input name="name" value={form.name} onChange={update} />
        </Control>
      </Field>
      <Field>
        <Control>
          <Label>Password</Label>
          <Input
            name="password"
            type="password"
            value={form.password}
            onChange={update}
          />
        </Control>
      </Field>
      <Button.Group>
        <Button
          fullwidth
          rounded
          color="primary"
          onClick={() => console.log(form)}
        >
          Login
        </Button>
      </Button.Group>
    </>
  );
}

export default BookForm;
